import React from "react"

function Header() {

    const title = "Mony is my life.";

    const desire = "Mony"
    if(desire === "Mony"){
        title = "Mony is my life.";
    }else{
        title = "Developing is my life."
    }
    return (
        <h1>Developing Is My Life.</h1>
    );
}

export default Header
